import "./ExpenseForm.css";

const ExpenseForm = () => {
  return (
    <div className="new-expense__controls">
      <form>
        <div>
          <label className="new-expense_control label"> Title</label>
          <input className="new-expense__control input" type="text" />
        </div>
        <div>
          <label className="new-expense_control label">Amount</label>
          <input className="new-expense__control input" type="text" />
        </div>
        <div>
          <label className="new-expense_control label">Date</label>
          <input className="new-expense__control input" type="date" />
        </div>
        <div className="new-expense__actions">
          <input className="new-expense__control input" value="Add Expense" type="SUBMIT" />
        </div>
      </form>
    </div>
  );
};

export default ExpenseForm;
